import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import axios from 'axios';

// Components
import Navbar from './components/layout/Navbar';
import Footer from './components/layout/Footer';
import Alert from './components/layout/Alert';

// Pages
import Home from './pages/Home';
import Register from './pages/Register';
import Login from './pages/Login';
import Dashboard from './pages/Dashboard';
import Profile from './pages/Profile';
import CourseDetail from './pages/CourseDetail';

// Set default axios settings
axios.defaults.baseURL = 'http://localhost:5000';

const App = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [user, setUser] = useState(null);
  const [token, setToken] = useState(localStorage.getItem('token'));
  const [loading, setLoading] = useState(true);
  const [alert, setAlert] = useState(null);

  useEffect(() => {
    // Check if user is authenticated
    const loadUser = async () => {
      if (token) {
        setAuthToken(token);
        try {
          const res = await axios.get('/api/auth/me');
          setUser(res.data);
          setIsAuthenticated(true);
        } catch (err) {
          localStorage.removeItem('token');
          setToken(null);
          setUser(null);
          setIsAuthenticated(false);
        }
      }
      setLoading(false);
    };

    loadUser();
  }, [token]);

  // Set token in headers
  const setAuthToken = (token) => {
    if (token) {
      axios.defaults.headers.common['x-auth-token'] = token;
      localStorage.setItem('token', token);
    } else {
      delete axios.defaults.headers.common['x-auth-token'];
      localStorage.removeItem('token');
    }
  };

  // Login user
  const login = async (email, password) => {
    try {
      const res = await axios.post('/api/auth/login', { email, password });
      setToken(res.data.token);
      return true;
    } catch (err) {
      showAlert(err.response?.data?.msg || 'Login failed', 'danger');
      return false;
    }
  };

  // Register user
  const register = async (name, email, password, studentId) => {
    try {
      const res = await axios.post('/api/auth/register', { name, email, password, studentId });
      setToken(res.data.token);
      return true;
    } catch (err) {
      showAlert(err.response?.data?.msg || 'Registration failed', 'danger');
      return false;
    }
  };

  // Logout user
  const logout = () => {
    setToken(null);
    setUser(null);
    setIsAuthenticated(false);
  };

  // Show alert
  const showAlert = (msg, type, timeout = 5000) => {
    setAlert({ msg, type });
    setTimeout(() => setAlert(null), timeout);
  };

  // Route protection
  const PrivateRoute = ({ children }) => {
    if (loading) return <div>Loading...</div>;
    return isAuthenticated ? children : <Navigate to="/login" />;
  };

  return (
    <Router>
      <div className="App">
        <Navbar isAuthenticated={isAuthenticated} user={user} logout={logout} />
        <main className="main-content">
          {alert && <div className="container"><Alert alert={alert} /></div>}
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/course/:id" element={<CourseDetail />} />
            <Route 
              path="/register" 
              element={
                <div className="container">
                  {!isAuthenticated ? <Register register={register} /> : <Navigate to="/dashboard" />}
                </div>
              } 
            />
            <Route 
              path="/login" 
              element={
                <div className="container">
                  {!isAuthenticated ? <Login login={login} /> : <Navigate to="/dashboard" />}
                </div>
              } 
            />
            <Route 
              path="/dashboard" 
              element={
                <div className="container">
                  <PrivateRoute>
                    <Dashboard user={user} />
                  </PrivateRoute>
                </div>
              } 
            />
            <Route 
              path="/profile" 
              element={
                <div className="container">
                  <PrivateRoute>
                    <Profile user={user} setUser={setUser} showAlert={showAlert} />
                  </PrivateRoute>
                </div>
              } 
            />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
};

export default App;
